import React from 'react'

function Cart({cartItems}) {
  console.log("hey ");
  console.log(cartItems);
  // if (!props.cartItems) {
  //   return <div>No items in the cart</div>;
  // }
  return (
    <div className='cart'>
      <h2>Cart</h2>
    
      {cartItems && cartItems.length>0? (cartItems.map((index, item)=>(
        <div key={index}>
        <h1>{item.name}</h1>
        </div>
      ))):(
        <p>Cart is empty</p>
      )}
    </div>
  )
}

export default Cart
